import Button from 'react-bootstrap/Button';
import '../ComponentStyles/filterComponent.css';
import { useState } from 'react';

function FilterComponent() {

    const [customSliderValue, setCustomSliderValue] = useState(0);

    const CustomSliderBackgroundFill = (e) => {
        setCustomSliderValue(e.target.value);
        const percent = (e.target.value / 100) * 100;
        e.target.style.background = `linear-gradient(to right, #8B4513 ${percent}%, #ccc ${percent}%)`;
      };

    return (
        <div className="filter-component-container">
            <div className="filter-component-title">
                <h3>Find Countries to Your Liking</h3>
            </div>
            <div className="filter-component-size-filter-container">
                <div className='filter-range-cont'>
                    <label>Minimum</label>
                    <input type='range' value={customSliderValue} onChange={(e) => CustomSliderBackgroundFill(e)} 
                        className='filter-range' />
                    <input type='range' className='filter-range' />
                    <input type='range' className='filter-range' />
                </div>
                <div className='filter-range-cont'>
                    <label>Maximum</label>
                    <input type='range' className='filter-range' />
                    <input type='range' className='filter-range' />
                    <input type='range' className='filter-range' />
                </div>
            </div>
            <div className="filterbyname-conatiner">
                <input className="form-control header-input" type="text" placeholder="Search for a Country.." />
                {"\u00A0"}
                {"\u00A0"}
                <Button variant="outline-success" className="header-btn header-search">
                    <i className="bi bi-binoculars"></i>
                </Button>
            </div>
        </div>
    )
}

export default FilterComponent;
